import React, { useState } from "react";
import { NavLink } from "react-router";

export default function SubList() {
    return (
        <ul className="sub-list">
            <li className="sub-list__item">
                <NavLink to="/museum" className="sub-list__link">Музей кіно</NavLink>
            </li>
            <li className="sub-list__item">
                <NavLink to="/school" className="sub-list__link">Школа кіно</NavLink>
            </li>
            <li className="sub-list__item">
                <NavLink to="/gallery" className="sub-list__link">Фотогалерея</NavLink>
            </li>
            <li className="sub-list__item">
                <NavLink to="/club" className="sub-list__link">Кіноклуб</NavLink>
            </li>
            <li className="sub-list__item">
                <NavLink to="/finding" className="sub-list__link">Краудфайндінг</NavLink>
            </li>
        </ul>
    );
}
